import { makeStyles } from "@mui/styles"

const homeStyles = makeStyles (() =>({
    card:{
        maxWidth: 345,
        color: '#ffffff',
        borderRadius:'12%',
        border: 1,
        borderColor: '#ffffff',
    },
    title:{
        marginLeft: '25px',
    },
    }
))

export default homeStyles
